package com.cp.thedailybyte.arraystring;

public class PalindromWithOneRemoval {

    public static void main(String[] ar) {
        PalindromWithOneRemoval obj = new PalindromWithOneRemoval();
        System.out.println(obj.validPalindrome("tacca")==true);
        System.out.println(obj.validPalindrome("abca")==true);
        System.out.println(obj.validPalindrome("") == true);
        System.out.println(obj.validPalindrome("abc")==false);
    }

    public boolean validPalindrome(String s) {
        if (s.length() <= 1) {
            return true;
        }
        //we will have two pointers . from left and from right
        //in case of mismatch we check if by removing one character(pointer shifting] is remaiing string palindrome or not
        //if yes return , otherwise keep repeating until end
        //if reached at end that means both pointer was always matching and is a palindrome string

        //O(N2) is time complexity

        char[] chars = s.toCharArray();
        int i = 0 , j = s.length() - 1;
        while(i < j) {
            if (chars[i] != chars[j]) {
                return isPalindrome(s, i + 1, j) || isPalindrome(s, i, j - 1);
            }
            i++;
            j--;
        }
        return true;
    }

    public boolean isPalindrome(String s, int low, int high) {
        while (low < high) {
            if (s.charAt(low) != s.charAt(high)) {
                return false;
            }
            low++;
            high--;
        }
        return true;
    }
}
